This one is entirely my own, including the field where you enter it and how it re-computes in real time and all that! It was a lot of work but I had a great time! (I am writing this before I've even implemented it, as motivation) Not that I invented the algorithm of course, it's extremely basic and you could probably find it in like 500BC textbooks. Caesar probably thought it was too trivial. And it's fairly practical to break if someone's smart and driven enough. For example if you know some basic prior info like the language of the hidden text, you can use word-frequency statistics of that language to reverse-engineer the gibberish. Maybe. Code and Explanation!!! /* I have omitted a lot of the code I thought would be irrelevant to you. All of it is of course there on the repository if you want a full look. I have omitted the ENTIRE real-time-website-updating logic here because I won't subject you to browser-facing js. AND. You made fun of me for asking permission to look at the site code. IT IS BECAUSE EVEN PRETTY LOOKING WELL-MADE APPS HAVE REALLY UGLY CODE AND IT DISILLUSIONS YOU A BIT. AND YOU MADE FUN OF ME FOR IT. I hope you're happy. And of course the carrd html is really ugly lol, but ALL of it is in a single html which is oh my god so incredible. Porting it was like 20 minutes of work lmao. I just had to download the 2 paintings and move them and it all works out of the box. Great choice of website-builder. */ /* Now! All characters as you know have a unique base-16 unicode id, which also means base-anything id. I immediately turn all of them to base 10 because it's convenient. While unicode exists all the way form id 0 up to id 1114111 (~17 * 2^16), not all of it has been assigned yet. Less than a sixth in fact is assigned. So it is a high probability that whenever a character is decoded with a wrong key, it will get mapped to a nonexist codepoint, which will just result in that ugly empty character that we get made fun of for on android. This function replaces them by deterministically mapping each of them to a valid unicode within our list. Doesn't matter that it will be a "wrong" (I spelled it werong while typing lmao) character after this mapping, because it's all gibberish anyway since your key is wrong to begin with and Raju grows ever impatient. */ function replace_if_invalid(x) { if (!valids_set.has(x)) { let valid_index = Math.abs(x % valids_len); return valids[valid_index]; } return x;
} /* This is where I combine the 4 keys to come up with the final, really long key. Basically, for as long as there's more than one key left, I pop out the last two, take their Cartesian product (lot simpler than it sounds, literally just forming every possible pair left-right. Cartesian([1, 2, 3], [4, 5]) is [(1, 4), (1, 5), (2, 4), (2, 5), (3, 4), (3, 5)]), and multiply the pairs and add 1 (adding 1 prevents trivially reverting them by getting their prime factors). So when we have as many as 4 keys, the numbers in the final key get really big and arbitrary-looking and the key gets really long. */ function combine_keys(keys) { while (keys.length > 1) { let last_key = keys.pop(); let penu_key = keys.pop(); let new_key = []; for (k1 of last_key) { for (k2 of penu_key) { new_key.push(k1 * k2 + 1); } } keys.push(new_key); } return keys[0];
} /* So I have these plaintext files sitting in the backend, but before I push them to the website, I delete all the text in the htmls produced, and place only these gibberish-integer lists in them. So on the website, you can't just inspect element and look at all the text, you literally have to know the keys or break the cipher. */ A little more lore for resilient adeventurers
I spent a big chunk of the first two whole fucking days basically REINVENTING THE FUCKING CAESAR CIPHER AT A FAR WORSE COMPUTATIONAL EFFICIENCY. I felt like running through a fucking wall when I realized what it was doing. And I wrote a whooole ass writeup for it code and all like above feeling oh so proud of myself lmao. It's truly a miracle I can get out of the bed in the morning without faceplanting. Oh and the other day after waking up I had the instinct to reach for my phone but the first thing in view was my eye-mask and I permutated and clicked it every which way to find the fucking power button so I could look at the time?
